	scwin.lfn_getSex = function(val) {
	    if ("1|3|5|7".indexOf(wconv.substr(val, 6, 1)) >= 0) {
	        return "1";
	    } else if ("2|4|6|8".indexOf(wconv.substr(val, 6, 1)) >= 0) {
	        return "2";
	    } else {
	        return "";
	    }
	};


