	scwin.lfn_B110_CallBack = function(rtnValue) { 		
		edt_sB110PopValue.setValue(rtnValue.edt_sB110PopValue);
	    fAgntFlag.setValue(rtnValue.fAgntFlag);
	    fAgntFlagIdx.setValue(rtnValue.fAgntFlagIdx);

	    switch (fAgntFlag.getValue()) {
	        case "ed_Mangi":
	            if (wconv.length(edt_sB110PopValue.getValue()) != 0) {
	                var resultArr = wconv.split(edt_sB110PopValue.getValue(), "^", true);
	                if (wconv.length(resultArr[0]) == 0) {
	                    Ds_LTIDA03.setCellData(0, "sEnntmPftbpFlagCd", ""); // 
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpRelnCd", ""); //       
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpCd", ""); //           
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpName", ""); //             
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpCntad", ""); //			
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpMailAddFlag", ""); //
	                    Ds_LTIDA03.setCellData(0, "nEndPftbpMailChngSeq", ""); //
	                    edt_sEnntmPftbpYn.setValue("");
	                } else {
	                    //
	                    if (resultArr[3].length == 10) {
	                        Ds_LTIDA03.setCellData(0, "sEnntmPftbpFlagCd", "2"); // 
	                        //
	                    } else {
	                        Ds_LTIDA03.setCellData(0, "sEnntmPftbpFlagCd", "1"); // 
	                    }
	                    Ds_LTIDA03.setCellData(0, "sEndPftbpRelnCd", resultArr[0]); //       
